Here is a basic AutoTune class in C++ that applies the classic "Cher effect" to audio input:

**autotune.h**
```c++
#ifndef AUTOTUNE_H
#define AUTOTUNE_H

#include <vector>
#include <complex>

class AutoTune {
public:
    AutoTune(int sampleRate, int bufferSize);
    ~AutoTune();

    void processBuffer(float* input, float* output, int numSamples);

private:
    void initFourierTransform();
    void applyAutotuneEffect(std::vector<std::complex<float>>& signal);

    int m_sampleRate;
    int m_bufferSize;
    std::vector<std::complex<float>> m_fourierTable;

};
#endif  // AUTOTUNE_H
```

**autotune.cpp**
```cpp
